D = {}

file = open('rna_codon.txt','r')
file = file.readlines()
L = []
for line in file:
    L += [line.rstrip().split()]
for line in L:
    D[line[0]] = line[1]

print(D)
s = ''
protein = ''
print(len(s))
for i in range(0,len(s)-3+1,3):
    #print(s[i:i+3])
    if D[s[i:i+3]] == 'STP':
        break
    else:
        protein += D[s[i:i+3]]
print(protein)

